import styled from "styled-components";
import { TextField }  from '@material-ui/core';

export const Wrapper = styled.div`
    display: flex;
    width: 100%;
    justify-content: space-between;

`;

export const STextField = styled(TextField)`

    width: 99%;

    Input{
        border: 1px solid #ccc;
    border-radius: 8px;
    }
`;
